#include <stdbool.h>

int gcd(int a, int b) {
    while (b != 0) {
        int temp = b;
        b = a % b;
        a = temp;
    }
    return a;
}

int minimumSeconds(int* nums, int numsSize) {
    if (numsSize == 1) return 0;
    // Creating an auxiliary array to find the cycle length
    bool visited[numsSize];
    for (int i = 0; i < numsSize; ++i) {
        visited[i] = false;
    }
    int cycleLength = 0;
    for (int i = 0; i < numsSize; ++i) {
        if (!visited[i]) {
            int j = i, cycle = 0;
            while (!visited[j]) {
                visited[j] = true;
                j = (j + 1) % numsSize;
                cycle++;
            }
            cycleLength = gcd(cycleLength, cycle);
        }
    }
    return cycleLength == numsSize ? 1 : (cycleLength % 2 == 0 ? 2 : 1);
}
